import Navigation from "./components/Navigation/index";
import Home from "./components/Home/index"
import About from "./components/About/index";
// import Project from "./components/Project/index";
import ContactForm from "./components/Contact/index";
import Footer from "./components/Footer/index";
import "bootstrap/dist/css/bootstrap.min.css";

import { BrowserRouter, Route, Switch } from 'react-router-dom'


function App() {
    return (
<BrowserRouter>
<Navigation/>
<Switch>
  <Route exact path="src/components/Navigation/index.js" component={Navigation} />
  <Route exact path="src/components/Home/index.js" component={Home} />
  <Route path='src/components/About/index.js' component={About} />
  <Route path='src/components/Contact/index.js' component={ContactForm} />
</Switch>
<Footer/>
</BrowserRouter>
    );
}

export default App;
